import React from 'react';

const Cursos = () => (
	<div class="container">
		<div class="row">
    		<div class="col">
      			Lista de Cursos
      		</div>
      		<div class="col">
      			Nuevo Curso
    		</div>
  		</div>
	</div>
);

export default Cursos;
